// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BatteryPassport {
    struct Battery {
        string batteryID;
        string manufacturer;
        string dateOfManufacture;
        string chemistry;
        uint256 capacity;
    }

    mapping(string => Battery) public batteries;

    // Register a new battery
    function registerBattery(
        string memory _batteryID,
        string memory _manufacturer,
        string memory _dateOfManufacture,
        string memory _chemistry,
        uint256 _capacity
    ) public {
        Battery memory newBattery = Battery(
            _batteryID,
            _manufacturer,
            _dateOfManufacture,
            _chemistry,
            _capacity
        );
        batteries[_batteryID] = newBattery;
    }

    // Fetch battery information by ID
    function getBattery(string memory _batteryID)
        public
        view
        returns (
            string memory,
            string memory,
            string memory,
            string memory,
            uint256
        )
    {
        Battery memory b = batteries[_batteryID];
        return (
            b.batteryID,
            b.manufacturer,
            b.dateOfManufacture,
            b.chemistry,
            b.capacity
        );
    }
}
